@-moz-document url-prefix("https://userstyles.org/") {
    .choose_editor .boxesContainer .box {
        background-color: #121212;
        box-shadow: none;
        border: 1px solid #333
    }
    .choose_editor {
        background-color: #141414;
        top: 0;/*wtf*/
    }
    .choose_editor .boxesContainer .box .title {
        color: #d9e2ec;
    }
    .choose_editor .boxesContainer .box .subtitle {
        color: #d9e2ec;
    }
    @media screen and (max-width:1024px){.logo{background-image:url(https://userstyles.org/ui/images/icons/stylish-icon.svg);height:24px;width:24px;}}
    @media screen and (min-width:801px){.navigation{margin-top:42px;}}
    body{font-family:-apple-system,BlinkMacSystemFont,Roboto,Helvetica Neue,Geneva,"Noto Sans Armenian","Noto Sans Bengali","Noto Sans Cherokee","Noto Sans Devanagari","Noto Sans Ethiopic","Noto Sans Georgian","Noto Sans Hebrew","Noto Sans Kannada","Noto Sans Khmer","Noto Sans Lao","Noto Sans Osmanya","Noto Sans Tamil","Noto Sans Telugu","Noto Sans Thai",sans-serif,arial,Tahoma,verdana;background:#121212;}
    #header,#header-mobile{height:42px;background:#232323;box-shadow:none;direction:ltr;}
    #nav-view-responsive{background:#121212;color:#ddd;}
    .logo{background:url(https://userstyles.org/ui/images/icons/stylish-icon.svg);height:24px;width:24px;}
    #top_android_button,.flags{display:none;}
    #title_div{box-shadow:none;}
    #create_new_style,.see_more,#install_style_button,.btn-auth,.us-stylecard__button-container .us-button,.personal-page .light-blue-button,.white_button,#archive_style_button,.css_button,#send_feedback_button,.choose_editor .boxesContainer .box .cta {margin:0;font-weight:400;background:#f67288;font-size:12.5px;cursor:pointer;min-height:auto;border-radius:4px;border:0;line-height:15px;display:flex;zoom:1;vertical-align:top;flex-direction:column;text-align:center;justify-content:center;color:#000000 !important;box-sizing:border-box;padding:7px 16px 8px;white-space:nowrap;box-shadow:none;}
    #create_new_style span,.see_more span,#install_style_button span,.btn-auth span,.us-stylecard__button-container .us-button span,.personal-page .light-blue-button span,.white_button span,#archive_style_button span,.css_button span,#send_feedback_button span{color:#000000 !important;}
    #wrapper-carousel,#installBox{margin-top:0px !important;}
    .us-stylecard--short .us-stencil{background:transparent;box-shadow:none;}
    #wrapper-carousel,.navigation .links-box,#single_discussion{box-shadow:none;}
    #actions_div #buttons div{margin-right:.5em;}
    .overlay_background,.android_button_banner,.android_button_button{display:none;opacity:0;}
    #create_new_style:hover,.see_more:hover,#install_style_button:hover,.btn-openid:hover,.btn-openid:focus,.btn-password:hover,.btn-password:focus,.btn-yahoo:hover,.btn-yahoo:focus,.btn-google:hover,.btn-google:focus,.btn-google:active,.us-stylecard__button-container .us-button:hover,.personal-page .light-blue-button:hover,.white_button:hover,#archive_style_button:hover,.css_button:hover,#send_feedback_button:hover, .choose_editor .boxesContainer .box .cta:hover{background:#f67288;border:0;color:#000000 !important;box-shadow:none;}
    .header-search .search_input .input_text_search{width:100%;height:100%;font-size:14px;color:#d9e2ec;background:#121212;border:0;padding:6px 6px 6px 19px;border-radius:0 14px 14px 0;line-height:16px;box-sizing:border-box;}
    .header-search{display:flex;width:100%;max-width:557px;height:28px;flex-direction:row;align-items:center;margin:7px 0;border:0;box-sizing:border-box;}
    .header-search .type_search{align-items:center;height:100%;border-radius:14px 0 0 14px;background:#121212;display:flex;position:relative;cursor:pointer;border:0;box-sizing:border-box;}
    .header-search .search_input{border-top-right-radius:14px;border-bottom-right-radius:14px;background:transparent;}
    .header-search .search_input.focused{background:transparent;}
    .header-search .type_search .type_search_select{width:calc(42px*2);border-radius:4px;background:#141414;box-shadow:none;}
    .header-search .type_search .type_search_select .type_search_option:hover{color:#d9e2ec;background:#f67288;}
    .header-search .type_search .type_search_select .type_search_option{font-size:13px;border-radius:4px;color:#d9e2ec;height:36px;line-height:16px;padding-left:8px;cursor:pointer;display:flex;align-items:center;}
    .navigation .links-box .navigation-link-active{border-left:0;}
    .logo-navigation-link{fill:red;}
    .navigation{background:#111111;position:fixed;z-index:2;box-shadow:none;overflow-y:hidden;top:0;}
    .navigation .links-box .navigation-link:hover{background:#252525;}
    .navigation .links-box .navigation-link{box-shadow:none;padding:13px 0 12px 0;display:flex;align-items:center;}
    .navigation .links-box .navigation-link .navigation-title{color:#ddd;margin:0 0 0 10px;}
    #information_value,#infomation_value_left,.text_style_page{color:#ddd;font-weight:400;}
    #information_key,#share_div,#information_key_left,#headline,#applies_link,.style_title,#copyrightsm,li,.login-option-explanation,#login p,label,span{color:#d9e2ec;font-weight:400;}
    #notes_textarea,#footer{background:#121212;color:#d9e2ec;border:0;}
    textarea,th,tr,.statistic table,th,td,input{background:#121212;color:#d9e2ec;border:1px solid #333;}
    #overlay-info{background:#121212;border-bottom-left-radius:4px;border-bottom-right-radius:4px;}
    #style-info-author-carousel a:visited{color:#ddd !important;}
    #style-info-author-carousel a, h1{color:#d9e2ec !important;}
    #style-info-title-carousel,*:not(.notes_textarea)>a,.bottomLinks{color:#f67288;}
    .us-stylecard--short,.us-stylecard--long{background:#121212;transition:all 0 ease;box-shadow:none;border:1px solid #333;}
    .us-stylecard--short:hover{box-shadow:none;transform:none;}
    h4 a:hover,.footer_link a,h4 a:visited,h4 a{color:#f67288 !important;}
    .btn-yahoo,.btn-google,.btn-google:hover,.btn-google:focus,.btn-google:active{background:none;}


}
